import React,{useRef} from 'react';
import Navbar from './Navbar';
import Header from './Header';
import AboutMe from './AboutMe';
import Projects from './Projects';
import Timeline from './Timeline';



const Home = () => {
    return (
        <React.Fragment>
            <Navbar/>
            <Header/>
            <AboutMe/>
            <Timeline/>
            <Projects/>
       </React.Fragment>
    );
};

export default Home;
